  console.log(e.target);
};

function HomePage() {
  return (
    <div className={style.container}>
      <input type="text" name="marca" placeholder="Marca: " id="marca" />
      <button type="button" onClick={(e) => handleClick(e)}>Agregar marca</button>
    </div>
  );
}

export default HomePage;
